def rolling_max(numbers: List[int]) -> List[int]:
    rolling_max_list = []

    for num in numbers:
        if not rolling_max_list:
            rolling_max_list.append(num)
        else:
            if num > rolling_max_list[-1]:
                rolling_max_list.append(num)
            else:
                rolling_max_list.append(rolling_max_list[-1])

